webpackJsonp([0xff6c4f6761d],{620:function(a,t){a.exports={data:{markdownRemark:{html:'<h3>Hackbot Improvements</h3>\n<p>We’ve improved HackBot to suggest single-click actions, such as:</p>\n<ul>\n<li>Creating a common response</li>\n<li>Integrating with an issue tracker</li>\n<li>Creating a trigger\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/oct_2016_hackbot-a833ff0d309f302813a16d28f3d35f3e-5d9fb.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 29.243937232524964%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="oct_2016_hackbot"\n        title=""\n        src="/static/oct_2016_hackbot-a833ff0d309f302813a16d28f3d35f3e-2f183.png"\n        srcset="/static/oct_2016_hackbot-a833ff0d309f302813a16d28f3d35f3e-67829.png 125w,\n/static/oct_2016_hackbot-a833ff0d309f302813a16d28f3d35f3e-5c59f.png 250w,\n/static/oct_2016_hackbot-a833ff0d309f302813a16d28f3d35f3e-2f183.png 500w,\n/static/oct_2016_hackbot-a833ff0d309f302813a16d28f3d35f3e-5d9fb.png 701w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n</ul>\n<h3>CVSS for Severity</h3>\n<p>We introduce the ability for both hackers and security teams to set severity via CVSS. Read our <a href="https://www.hackerone.com/blog/introducing-severity-cvss">blog post</a> or <a href="https://docs.hackerone.com/programs/severity.html">docs article</a> to learn more.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/oct_2016_cvss-94b52e55c5792b895c5f9126d6f75d10-8ad72.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 43.459915611814345%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="oct_2016_cvss"\n        title=""\n        src="/static/oct_2016_cvss-94b52e55c5792b895c5f9126d6f75d10-2f183.png"\n        srcset="/static/oct_2016_cvss-94b52e55c5792b895c5f9126d6f75d10-67829.png 125w,\n/static/oct_2016_cvss-94b52e55c5792b895c5f9126d6f75d10-5c59f.png 250w,\n/static/oct_2016_cvss-94b52e55c5792b895c5f9126d6f75d10-2f183.png 500w,\n/static/oct_2016_cvss-94b52e55c5792b895c5f9126d6f75d10-8ad72.png 711w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>No Attachment Warning</h3>\n<p>We now display a warning message if your report references an attachment but no attachments are found.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/oct_2016_no_attachment-695bbc33679e5a8d96cf8d5ac9caeb4b-1ce18.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 41.0351201478743%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="oct_2016_no_attachment"\n        title=""\n        src="/static/oct_2016_no_attachment-695bbc33679e5a8d96cf8d5ac9caeb4b-2f183.png"\n        srcset="/static/oct_2016_no_attachment-695bbc33679e5a8d96cf8d5ac9caeb4b-67829.png 125w,\n/static/oct_2016_no_attachment-695bbc33679e5a8d96cf8d5ac9caeb4b-5c59f.png 250w,\n/static/oct_2016_no_attachment-695bbc33679e5a8d96cf8d5ac9caeb4b-2f183.png 500w,\n/static/oct_2016_no_attachment-695bbc33679e5a8d96cf8d5ac9caeb4b-c93e8.png 750w,\n/static/oct_2016_no_attachment-695bbc33679e5a8d96cf8d5ac9caeb4b-4e628.png 1000w,\n/static/oct_2016_no_attachment-695bbc33679e5a8d96cf8d5ac9caeb4b-1ce18.png 1082w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Hacker Profile: Thanks Page Improvements</h3>\n<p>We’ve totally revamped our Thanks page on the hacker profile so that all the programs hackers have made contributions to, are now listed in the order of most reputation earned. We also display for each program:</p>\n<ul>\n<li>The number of valid and closed reports the hacker has</li>\n<li>The reputation earned</li>\n<li>The rank of the hacker\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/oct_2016_hacker_profile_thanks-4fe09734b224d7e164d9322114932932-3ea14.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 30.485232067510548%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="oct_2016_hacker_profile_thanks"\n        title=""\n        src="/static/oct_2016_hacker_profile_thanks-4fe09734b224d7e164d9322114932932-2f183.png"\n        srcset="/static/oct_2016_hacker_profile_thanks-4fe09734b224d7e164d9322114932932-67829.png 125w,\n/static/oct_2016_hacker_profile_thanks-4fe09734b224d7e164d9322114932932-5c59f.png 250w,\n/static/oct_2016_hacker_profile_thanks-4fe09734b224d7e164d9322114932932-2f183.png 500w,\n/static/oct_2016_hacker_profile_thanks-4fe09734b224d7e164d9322114932932-c93e8.png 750w,\n/static/oct_2016_hacker_profile_thanks-4fe09734b224d7e164d9322114932932-3ea14.png 948w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n</ul>',frontmatter:{path:"/changelog/2016/october",title:"October 2016"}}},pathContext:{}}}});
